css:
@-moz-document url-prefix("https://porofessor.gg/live/") {
.site-content-bg, body, .site-header {
    background-color: #000000;
}

.card .cardBody {
    background-color:#101214 !important
}
.card .cardBody .box {
    background-color: #070809;
}
.card .tags-box .tag.green {
    background-color:#0fa4ff;
}
#teamRecaps > ul, body > footer, #teamRecaps, body > header > div > div > div.social-media, body > header > div > div > div.log-logo, #liveContent > div.site-content.site-content-bg > div.site-content-header, #filters-menu {
    display:none!important;
}
.card .tags-box .tag.yellow {
    background-color: #bf8300;
}

body > main {
    margin-top:-18px;
}

body > header {
    padding-bottom:0px!important
}

}
